import React from "react";
import { Box } from "@material-ui/core";
import { grey } from "@material-ui/core/colors";

const ProductView = () => {
  return (
    <Box>
      <img
        style={{ height: "120px", width: "120px", backgroundColor: grey[50] }}
      />
    </Box>
  );
};

export default ProductView;
